// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

//@developed by andrew mitchell (andrewmitchell.eth)
//This is the engine for creating the animation url's html header and html footer.
contract ProzacYouthEngine_1 {

    //Parameters: 
    //andrewUrl - the url to Andrew Mitchell's website, if it changes this can be updated in ProzacYouthUtils.sol.
    //entriesHtml - these are the entries as HTML which are created in ProzacYouthUtils.sol
